import React from 'react'
import Header from'../header/Header'
import { Typography, makeStyles, Box } from '@material-ui/core'; 
import homepage from '/Users/shelabhtyagi/Desktop/car wash/car-wash/src/components/images/homepage.webp'

const useStyle = makeStyles((theme) => ({
	component: {
	    backgroundColor: 'rgba(61, 153, 252, 1)',
	    width: '100%',
	    height: 886
	  },

	subTitle: {
	    padding: '200px 0 0 100px',
	    color: 'white',
	    fontSize: '34px',


	},
	img: {
		width: '926px',
		height: '700px',
		marginTop: '-260px',
		marginLeft: '800px'
	},
	title:{
		marginTop: '-430px',
		marginLeft: '98px',
		fontSize: '62px',
		color: 'white',
	},
	sub:{
		color: 'yellow',
		fontSize: '34px',
		marginTop: '200px',
		marginLeft: '100px'
	},
	line1: {
		width: '491px',
		height: '14px',
		background: 'rgba(101, 246, 255, 0.65)',
		opacity: '65%',
		marginTop: '-20px'

	}

      }));




function Home() {
	const classes = useStyle();
	return (
		<div>
			<Header />
			<Box className={classes.component}>
				<Typography className={classes.subTitle}>
					The best<br/>Carwash in your area!
				</Typography>
				<img className={classes.img} src={
					homepage}
				 />
				<Typography className={classes.title}>
					CLEAN SHINY CAR
				</Typography>
				<div className={classes.line1}></div>
				<Typography className={classes.sub}>
					Subscribe Today
				</Typography>







			</Box>
		</div>
	)
}

export default Home;
